DROP TABLE IF EXISTS `admin_resource`;
CREATE TABLE `admin_resource` (
  `id` bigint(20) NOT NULL COMMENT 'ID（手动维护）',
  `code` varchar(50) NOT NULL COMMENT '代码字段（大写字母，下划线，数字组成，不能以数字打头），且只能初始化不能修改；',
