  UNIQUE KEY `uk_appid_code` (`app_id`,`code`),
  KEY `idx_pid_type_orderno` (`pid`,`type`,`order_no`),
  KEY `idx_pid` (`pid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=COMPACT COMMENT='资源信息表（菜单、操作等)';

