-- ----------------------------
--  Table structure for `admin_user`
-- ----------------------------
DROP TABLE IF EXISTS `admin_user`;
CREATE TABLE `admin_user` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '用户的自增id号',
  `mch_id` bigint(20) NOT NULL COMMENT '所属商户id',
  `login_name` varchar(20) NOT NULL COMMENT '登录名',
  `login_pwd` varchar(32) NOT NULL COMMENT '登录密码',
  `real_name` varchar(50) DEFAULT NULL COMMENT '真实姓名',
  `status` int(11) NOT NULL DEFAULT '1' COMMENT '0为禁用，1为启用',
  `is_delete` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否删除  0-否 1-是',
  `mobile` varchar(20) DEFAULT NULL COMMENT '手机号',
  `email` varchar(100) DEFAULT NULL COMMENT 'email',
  `dept_id` int(11) NOT NULL COMMENT '部门id',
  `oper_code` varchar(10) DEFAULT NULL COMMENT '操作员编码',
  `sex` char(1) DEFAULT NULL COMMENT '性别：1：男，0：女',
  `address` varchar(50) DEFAULT NULL COMMENT '联系地址',
  `gmt_create` datetime NOT NULL COMMENT '创建时间',
  `gmt_modified` datetime NOT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_loginname` (`login_name`),
  KEY `idx_mchid` (`mch_id`)
) ENGINE=InnoDB AUTO_INCREMENT=30 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='用户表';

