-- ----------------------------
--  Table structure for `base_country`
-- ----------------------------
DROP TABLE IF EXISTS `base_country`;
CREATE TABLE `base_country` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `iso` varchar(2) NOT NULL,
  `iso3` varchar(3) DEFAULT NULL,
  `name_cn` varchar(30) DEFAULT NULL COMMENT '中文名称',
  `name_en` varchar(30) DEFAULT NULL COMMENT '英文名称',
  `name` varchar(80) NOT NULL,
  `numcode` int(5) DEFAULT NULL,
  `phonecode` int(5) NOT NULL,
  `area` varchar(20) DEFAULT NULL COMMENT '所在的洲',
  `sort` int(4) DEFAULT '0' COMMENT '排序用',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=240 DEFAULT CHARSET=utf8 COMMENT='国际电话号码区号';

