DROP TABLE IF EXISTS `base_fee`;
CREATE TABLE `base_fee` (
  `id` int(8) NOT NULL DEFAULT '0' COMMENT 'id',
  `region_type` tinyint(4) DEFAULT NULL COMMENT '：1-运营区域，2-非运营区域，3-正常停放区域  4-禁止停区',
  `price` decimal(10,2) DEFAULT NULL COMMENT '骑车每分钟单价',
  `basic_fare` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '基本费用金额',
  `park_fee` decimal(10,2) DEFAULT '0.00' COMMENT '停车扣款',
  `gmt_create` bigint(20) DEFAULT NULL,
  `gmt_modified` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='基础费用表';

