-- ----------------------------
--  Table structure for `bill_refund`
-- ----------------------------
DROP TABLE IF EXISTS `bill_refund`;
CREATE TABLE `bill_refund` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='退款流水表';

-- ----------------------------
--  Table structure for `bill_with_draw`
-- ----------------------------
DROP TABLE IF EXISTS `bill_with_draw`;
CREATE TABLE `bill_with_draw` (
  `id` bigint(20) NOT NULL COMMENT '提现流水id',
  `user_id` bigint(20) NOT NULL COMMENT '用户id',
  `bank_code` varchar(20) NOT NULL COMMENT '银行编码',
  `bank_name` varchar(20) NOT NULL COMMENT '开户行名称',
  `bank_branch_name` varchar(30) DEFAULT NULL COMMENT '分行名称',
  `bank_account_name` varchar(30) NOT NULL COMMENT '账户名称',
  `bank_card_no` varchar(20) NOT NULL COMMENT '银行卡号',
  `amount` decimal(10,2) NOT NULL COMMENT '提现金额',
  `with_draw_type` tinyint(4) NOT NULL COMMENT '提现类型 1-快速提现 2-普通提现',
  `status` tinyint(4) NOT NULL COMMENT '0-提现申请 1-申请成功 2-提现支付中 3-提现成功 4-提现失败',
  `pay_time` datetime DEFAULT NULL COMMENT '提现支付时间',
  `pay_url` varchar(200) DEFAULT NULL COMMENT '打款凭证',
  `gmt_create` datetime NOT NULL COMMENT '创建时间',
  `gmt_modified` datetime NOT NULL COMMENT '修改时间',
  `auditing_user_id` bigint(20) DEFAULT NULL,
  `auditing_user_name` varchar(20) DEFAULT NULL,
  `auditing_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `idx_userid` (`user_id`),
  KEY `idx_status` (`status`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='提现流水表';

