-- ----------------------------
--  Table structure for `order_info`
-- ----------------------------
DROP TABLE IF EXISTS `order_info`;
CREATE TABLE `order_info` (
  `id` bigint(20) NOT NULL COMMENT '订单id',
  `order_type` tinyint(4) NOT NULL COMMENT '订单类型：1-普通购物型  2-钢管等带车辆运输型',
  `buy_user_id` bigint(20) NOT NULL COMMENT '买家id',
  `buy_user_name` varchar(50) DEFAULT NULL COMMENT '买家真实姓名',
  `sale_user_id` bigint(20) NOT NULL COMMENT '卖家id',
  `sale_user_name` varchar(50) DEFAULT NULL COMMENT '卖家真实姓名',
  `amount` decimal(10,2) NOT NULL COMMENT '订单总金额(分)',
  `pay_amount` decimal(10,2) DEFAULT NULL COMMENT '支付总金额(分)',
  `goods_id` bigint(20) NOT NULL COMMENT '商品id',
  `goods_name` varchar(200) DEFAULT NULL COMMENT '商品名称-冗余字段',
  `amount_unit` varchar(200) DEFAULT NULL COMMENT '商品规格数量单位list简化信息',
  `category_id` int(11) NOT NULL COMMENT '类目id',
  `category_name` varchar(10) DEFAULT NULL COMMENT '类目名称-冗余字段',
  `quality` tinyint(4) DEFAULT NULL COMMENT '''成色  1-全新  2-二手 3-不限''',
  `quality_spec_id` int(11) DEFAULT NULL COMMENT '商品销售的品质规格id',
  `quality_spec_name` varchar(20) DEFAULT NULL COMMENT '商品销售的品质规格名称-冗余字段',
  `total_amount` decimal(10,2) DEFAULT NULL COMMENT '总数量',
  `total_weight` decimal(10,2) DEFAULT NULL COMMENT '总重量(磅重)-手动输入 单位(吨）',
  `price` decimal(10,2) DEFAULT NULL COMMENT '单价',
  `pay_type` tinyint(4) DEFAULT NULL COMMENT '支付方式：1-支付宝，2-微信，3-会员账户  4-线下支付',
  `pay_time` datetime DEFAULT NULL COMMENT '用户支付时间',
  `pay_trade_no` varchar(32) DEFAULT NULL COMMENT '收银台返回交易流水号',
  `out_trade_no` varchar(32) DEFAULT NULL COMMENT '支付订单号，传给收银台；发起支付时填入',
  `consignee` varchar(30) NOT NULL COMMENT '收货人',
  `mobile` varchar(15) NOT NULL COMMENT '收货人手机号码',
  `address` varchar(300) NOT NULL COMMENT '收货人详细地址',
  `remark` varchar(200) DEFAULT NULL COMMENT '备注',
  `close_time` datetime DEFAULT NULL COMMENT '未支付订单关闭截止时间',
  `order_status` tinyint(4) NOT NULL COMMENT '订单状态：1-待确认单价、2-待提货、 3-待装卸、 4-待支付 、5-待卖家确认、 6-待发货、 7-待收货、 8-已完成、9-退款中、10-退款成功、99-交易已关闭',
  `trade_status` tinyint(4) NOT NULL COMMENT '支付状态：1-待付款，2-付款中，3-付款成功，4-失败待干预',
  `estimate_status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '评价状态  0-未评价  1-买家已评价  2-卖家已评价 3-双方已评价',
  `gmt_create` datetime NOT NULL COMMENT '创建时间',
  `gmt_modified` datetime NOT NULL COMMENT '最后修改时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_outtradeno` (`out_trade_no`),
  KEY `idx_userid` (`buy_user_id`),
  KEY `idx_orderstatus_paystatus` (`order_status`,`trade_status`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='订单基础表';

