-- ----------------------------
--  Table structure for `order_pay_flow`
-- ----------------------------
DROP TABLE IF EXISTS `order_pay_flow`;
CREATE TABLE `order_pay_flow` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `order_id` bigint(20) NOT NULL COMMENT '订单id',
  `trade_no` varchar(50) NOT NULL COMMENT '交易流水号',
  `pay_amount` decimal(10,2) NOT NULL COMMENT '付款金额  用户在交易中支付的金额',
  `receipt_amount` decimal(10,2) NOT NULL COMMENT '实收金额  商家在交易中实际收到的款项，单位为元',
  `total_amount` decimal(10,2) NOT NULL COMMENT '本次交易支付的订单金额，单位为人民币（元）',
  `gmt_paycreate` datetime DEFAULT NULL COMMENT '支付创建时间',
  `gmt_payment` datetime NOT NULL COMMENT '支付时间',
  `trade_status` varchar(32) NOT NULL COMMENT '支付状态',
  `buyer_logon_id` varchar(100) NOT NULL COMMENT '支付者账号',
  `buyer_id` varchar(50) NOT NULL COMMENT '支付用户号',
  `notify_time` datetime NOT NULL COMMENT '异步通知时间',
  `sign` varchar(256) DEFAULT NULL COMMENT '通知的签名',
  `params_content` varchar(2000) NOT NULL COMMENT '异步通知的全部参数内容',
  `gmt_create` datetime NOT NULL COMMENT '创建时间',
  `gmt_modified` datetime NOT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`),
  KEY `idx_orderid` (`order_id`)
) ENGINE=InnoDB AUTO_INCREMENT=54 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='订单支付流水表';

