CREATE TABLE `order_ride_info` (
  `id` bigint(20) NOT NULL COMMENT '订单id',
  `user_id` bigint(20) NOT NULL COMMENT '用户id',
  `bike_no` varchar(20) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '单车编号',
  `start_time` bigint(20) DEFAULT NULL COMMENT '骑行开始时间',
  `end_time` bigint(20) DEFAULT NULL COMMENT '骑行结束时间',
  `start_lat` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '开始纬度',
  `start_lng` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '开始经度',
  `end_lat` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '结束纬度',
  `end_lng` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '结束经度',
  `ride_distance` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '骑行距离',
  `price` decimal(10,2) DEFAULT NULL COMMENT '单价',
  `basic_fare` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '基本费用金额',
  `park_fee` decimal(10,2) DEFAULT '0.00' COMMENT '停车扣款',
  `amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '金额',
  `pay_amount` decimal(10,2) DEFAULT NULL COMMENT '支付总金额(分)',
  `pay_type` tinyint(4) DEFAULT NULL COMMENT '支付方式：1-支付宝，2-微信，3-会员账户  4-线下支付',
  `pay_time` datetime DEFAULT NULL COMMENT '用户支付时间',
  `pay_trade_no` varchar(32) DEFAULT NULL COMMENT '收银台返回交易流水号',
  `out_trade_no` varchar(32) DEFAULT NULL COMMENT '支付订单号，传给收银台；发起支付时填入',
