  `itinerary_status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '行程单开具状态  0-未开具  1-已开具',
  `estimate_status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '评价状态  0-未评价  1-已评价  ',
