INSERT INTO `sys_msg_template` VALUES ('1', '1', '认证审核已成功提交', '您提交的（${verifyName}）已于${dateTime}成功提交。星享租将在1-3个工作日内完成审核工作', null), ('2', '1', '认证审核已成功通过', '您提交的（${verifyName}）已通过星享租的审核。您可以去个人中心查看自己相对应的会员权利。', null), ('3', '1', '认证审核未通过认证', '您提交的（${verifyName}）未通过星享租的审核，原因：${reason} 。请您认真填写，重新提交审核。若有问题，可联系在线客服。', null), ('4', '2', '银行卡已提交', '您提交的尾号为：（${bankCardNo}）的银行卡，已于${dateTime}成功提交。星享租将在1-3个工作日内完成审核工作，并进行打款。请您随时注意银行卡余额。', null), ('5', '2', '银行卡待绑验证', '星享租已完成对您银行卡的验证、打款操作，请您及时到个人中心-我的账户完成验证操作。', null), ('6', '2', '银行卡已成功绑定', '您的银行卡已通过星享租的验证流程。您可以去个人中心-我的账户中查看及进行提现操作。', null), ('7', '3', '订单待设置单价', '您的品类：（${category}）规格：（${spec}），已被（${buyer}）拍下，请您尽快设置单价，有助于您交易的尽快完成。', null), ('8', '3', '待安排提货', '您购买的：订单号【${orderId}】，卖家已设置单价，请填写司机信息，安排司机提货。', null), ('9', '3', '待安排装卸', '您销售的：订单号【${orderId}】，买家已经安排司机提货，请您安排好装卸事宜，并在装卸完成之后，填写装卸信息。', ''), ('10', '3', '订单待支付', '您购买的：订单号【${orderId}】，装卸已完成，已生成总价，请您尽快支付，以免延误卖家发货。', null), ('11', '3', '订单待发货', '您销售的：订单号【${orderId}】，买家已完成付款，请您尽快发货。', null), ('12', '3', '订单待收货', '您购买的：订单号【${orderId}】，卖家已发货，请您收到货后，及时确认。', null), ('13', '3', '订单待评价', '您购买的：订单号【${orderId}】，订单已完成，建议您尽快评价，方便您日后的交易。', null), ('14', '3', '订单待评价', '您销售的：订单号【${orderId}】，买家已确认收货，建议您尽快进行评价，方便您日后的交易。', null), ('15', '3', '自动确认收货', '您购买的：订单号【${orderId}】，距离自动确认收货时间还有${days}天时间，请您尽快确认收货。若有问题，可与卖家沟通或与星享租客服沟通。', null), ('16', '4', '提现申请已提交', '您的提现申请： 流水号【${withDrawId}】已于${dateTime} 成功提交。星享租将在1-3个工作日内完成审核工作，并进行打款。', null), ('17', '4', '提现申请已通过', '您的提现申请： 流水号【${withDrawId}】已通过星享租的审核，并安排了打款。请您注意从今天起的1-3工作日内的银行余额。', null), ('18', '5', '${msgType}已审核通过', '您提交的（${msgType}） 品类：（${category}）规格：（${spec}）已成功发布。请您及时注意客户回复您的讯息。', null), ('19', '6', '租赁信息审核通知', '您提交的 ${leaseTitle} 已经审核通过。 ', null), ('20', '6', '租赁信息审核通知', '您提交的 ${leaseTitle} 审核不通过，原因：${reason} 。如有疑问请联系在线客服。', null), ('21', '7', '买卖信息审核通知', '您提交的 ${goodsTitle} 已经审核通过。', null), ('22', '7', '买卖信息审核通知', '您提交的 ${goodsTitle} 审核不通过，原因：${reason} 。如有疑问请联系在线客服。', null);
