DROP TABLE IF EXISTS `sys_news`;
CREATE TABLE `sys_news` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `news_type` tinyint(4) NOT NULL COMMENT '类型  1-数据库文体型  2- url外链型',
  `news_tag` varchar(200) DEFAULT NULL COMMENT '新闻标签',
  `news_category` tinyint(4) NOT NULL DEFAULT '1' COMMENT '资讯类别  1-热点  2-资讯  3-行情 ',
  `news_template_id` int(11) NOT NULL COMMENT '新闻模板id',
  `news_title` varchar(50) NOT NULL COMMENT '新闻标题',
  `news_short_des` varchar(200) DEFAULT NULL COMMENT '新闻简短描述',
  `news_url` varchar(200) DEFAULT NULL COMMENT '外链url',
  `news_pic` varchar(1000) DEFAULT NULL COMMENT '标题配图，多个用逗号隔开。七牛完整链接',
  `news_author` varchar(20) NOT NULL COMMENT '作者',
  `news_gmt_create` datetime NOT NULL COMMENT '资讯发布时间',
  `is_top` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否置顶  0-否 1-是',
  `read_times` int(11) DEFAULT NULL COMMENT '阅读次数',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '状态 0-初始化  1-正常',
  `create_user_id` int(11) DEFAULT NULL COMMENT '创建人id',
  `create_user_name` varchar(20) DEFAULT NULL COMMENT '创建人名称',
  `update_user_id` int(11) DEFAULT NULL COMMENT '修改人id',
  `update_user_name` varchar(20) DEFAULT NULL COMMENT '修改人名称',
  `gmt_create` datetime NOT NULL COMMENT '创建时间',
  `gmt_modified` datetime NOT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`),
  KEY `idx_newstype_newscategory` (`news_type`,`news_category`)
) ENGINE=InnoDB AUTO_INCREMENT=35 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='新闻资讯表';

