INSERT INTO `sys_news_template` VALUES ('1', '新闻模板1', '<html lang=\"zh-CN\">\n<head>\n    <meta name=\"applicable-device\" content=\"pc,mobile\" />\n    <meta name=\"MobileOptimized\" content=\"width\" />\n    <meta name=\"HandheldFriendly\" content=\"true\" />\n    <meta name=\"format-detection\" content=\"telephone=no\" />\n    <meta name=\"theme-color\" content=\"#ea6f5a\" />\n    <meta  charset=\"utf-8\" />\n    <meta  name=\"viewport\" content=\"width=device-width, initial-scale=1, maximum-scale=1, user-scalable=no\" />\n    <title>星享租</title>\n    <link rel=\"stylesheet\" href=\"http://images.zhixingchuyun.com/static/css/app.css\" />\n    <link rel=\"stylesheet\" href=\"http://images.zhixingchuyun.com/static/css/styleapp.css\" />\n    <meta  name=\"description\" content=\"\" data-n-head=\"true\" />\n</head>\n<body class=\"reader-day-mode normal-size\">\n<div id=\"app\">\n    <section id=\"layout-default\">\n        <div class=\"main-view\">\n            <div id=\"note-show\">\n                <div class=\"note\">\n                    <h1 class=\"title\">${newsTitle}</h1>\n                    <div class=\"article-info\">\n                        <div class=\"meta\">\n                            <span>${newsAuthor}</span>\n                            <span>${createTime}</span>\n                        </div>\n                    </div>\n                    <div class=\"content\">\n                        <div class=\"show-content-free\">\n                            <div class=\"collapse-free-content set\" >\n                                <div class=\"set\">\n                                ${newsContent}\n                                </div>\n                            </div>\n                        </div>\n                    </div>\n                    <div class=\"article-footer\">\n                        <div class=\"article-footer\">\n                            <div class=\"like-btn\"><span>阅读次数：</span><span class=\"badge\"> ${readTimes}</span></div>\n                        </div>\n                    </div>\n                    <hr />\n                </div>\n            </div>\n    </section>\n</div>\n<div class=\"progress\" style=\"width: 0%; height: 2px; background-color: rgb(234, 111, 90); opacity: 0;\"></div>\n</body>\n</html>', '1', '2018-09-26 10:35:11', '2018-09-26 10:35:13');
COMMIT;

