INSERT INTO `sys_news_text` VALUES ('32', 'afddasfkljlksfsfsdfsf '), ('33', '<p>　　据中钢网资讯研究院消息：回顾昨日，全国热卷稳中有跌，期货先强后弱，且下游整体需求暂未明显改观，但鉴于库存量较小，商家谨慎观望情绪浓厚。</p>\r\n\r\n<p>从宏观角度来看，与行业相关的重大消息主要有以下几点：</p>\r\n\r\n<p><img alt=\"\" src=\"http://images.zhixingchuyun.com/ZX_0925105315_8pgkss.jpg\" /></p>\r\n\r\n<p>　　一、据中国钢铁工业协会网站消息，中国钢铁工业协会党委书记、秘书长刘振江9月20日在第十八届中国钢铁原材料国际研讨会上发表讲话称，从阶段性看，中国钢产量已经由过去的快速增长期转入了相对平稳的、波动较小的峰值平台期。他表示，这是个阶段性的增长方式的重要转变。中国钢产量的这一阶段性平台期不可能转眼即逝，支撑它的是中国持续发展中偌大市场的刚性需求。</p>\r\n\r\n<p>　　二、中国钢铁工业协会秘书长刘振江在一次会议上接受采访时表示，与去年相比，今年钢厂不太可能普遍被要求按一定比例减产。如果空气质量良好，需要的减产就会减少，反之亦然，他周三在大连表示，符合排放标准的工厂将获得豁免。</p>\r\n\r\n<p>　　三、据中钢协初步数据，9月上旬中钢协会员企业粗钢日均产量为197.2万吨，旬比增长3.69%;截至该旬末，重点钢企钢材库存为1225万吨，旬比增长2.69%。</p>\r\n\r\n<p>　　四、据中钢网数据分析：全国24个主要市场3.0 热轧板卷平均价格4412元/吨，较上个交易日下调6元/吨。全国24个主要市场4.75 热轧板卷平均价格4354元/吨，较上个交易日下调6元/吨。</p>\r\n\r\n<p>　　五、昨日热卷期货主力热卷期货主力1901合约收盘价3978，跌36，跌幅0.90%。</p>\r\n\r\n<p>　　六、期螺夜盘：期螺01开4116，低开后企稳回升，最高4151，最低4106，收4147，涨4涨幅0.10%。期螺短期由跌趋稳，投资者可暂观望，激进者可逢低增多。(注：所有主力合约涨跌幅度为与上一日结算价之差)。</p>\r\n\r\n<p>　　综合以上信息，中钢网资讯研究院认为，当前现货市场心态稍有分歧，各地区商家操作略显不一，多松动出货，但考虑库存方面有所支撑，个别贸易商不愿降价销售，下游厂商入市积极性不高，资源整体成交无明显改观，综合分析，利好利空行情交织下，预计今日国内热轧市场稳中盘整。</p>'), ('34', '<table border=\"1\" cellspacing=\"0\" style=\"border-collapse:collapse; width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\"8\">10月15日上海市场焊管价格行情(仅供参考，不作为出货/采购等任何依据。)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>品名</td>\r\n			<td>规格（mm）</td>\r\n			<td>公称口径</td>\r\n			<td>材质</td>\r\n			<td>产地</td>\r\n			<td>价格（元/吨）</td>\r\n			<td>涨跌</td>\r\n			<td>备注</td>\r\n		</tr>\r\n		<tr>\r\n			<td>焊管</td>\r\n			<td>4分*2.75mm</td>\r\n			<td>DN15</td>\r\n			<td>Q195-215</td>\r\n			<td>衡水华岐</td>\r\n			<td>4980</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>焊管</td>\r\n			<td>6分*2.75mm</td>\r\n			<td>DN20</td>\r\n			<td>Q195-215</td>\r\n			<td>衡水华岐</td>\r\n			<td>4970</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>焊管</td>\r\n			<td>1寸*3.25mm</td>\r\n			<td>DN25</td>\r\n			<td>Q195-215</td>\r\n			<td>