-- ----------------------------
--  Table structure for `user_account`
-- ----------------------------
DROP TABLE IF EXISTS `user_account`;
CREATE TABLE `user_account` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '自增主键',
  `user_id` bigint(20) NOT NULL COMMENT '用户id',
  `total_amt` decimal(10,3) NOT NULL DEFAULT '0.000' COMMENT '账户余额',
  `frozen_amt` decimal(10,3) NOT NULL DEFAULT '0.000' COMMENT '冻结余额 (不可提现)',
  `total_points` int(11) DEFAULT NULL COMMENT '用户积分',
  `frozen_points` int(11) DEFAULT NULL COMMENT '冻结积分',
  `status` tinyint(4) NOT NULL COMMENT '状态 1-正常 ',
  `gmt_create` datetime NOT NULL COMMENT '创建时间',
  `gmt_modified` datetime NOT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_userid` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='用户账户信息表';

