-- ----------------------------
--  Table structure for `user_account_log`
-- ----------------------------
DROP TABLE IF EXISTS `user_account_log`;
CREATE TABLE `user_account_log` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) NOT NULL COMMENT '用户id',
  `account_type` tinyint(4) NOT NULL COMMENT '账户类型  1-可提现账户  2-冻结账户  3-积分账户  4-积分冻结账户',
  `trans_order_id` bigint(20) NOT NULL COMMENT '交易关联的订单号',
  `trans_amount` decimal(10,2) NOT NULL COMMENT '交易金额',
  `trans_type` tinyint(4) NOT NULL COMMENT '1-充值 2-销售入账余额 3-提现  4-冻结金额解冻 5-销售金额入账冻结余额  6-提现失败回退 99-其他类型',
  `trans_time` datetime NOT NULL COMMENT '交易发生时间',
  `remark` varchar(100) DEFAULT NULL COMMENT '交易备注信息',
  `gmt_create` datetime NOT NULL COMMENT '创建时间',
  `gmt_modified` datetime NOT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`),
  KEY `idx_userid` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=61 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='账户余额变化日志';

