-- ----------------------------
--  Table structure for `user_address`
-- ----------------------------
DROP TABLE IF EXISTS `user_address`;
CREATE TABLE `user_address` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) NOT NULL COMMENT '用户id',
  `address_name` varchar(20) DEFAULT NULL COMMENT '收货地址别名',
  `consignee` varchar(20) NOT NULL COMMENT '收货人姓名',
  `province` varchar(10) DEFAULT NULL COMMENT '省份',
  `city` varchar(10) DEFAULT NULL COMMENT '市',
  `district` varchar(10) DEFAULT NULL COMMENT '区',
  `address` varchar(200) NOT NULL COMMENT '详细地址',
  `mobile` varchar(15) NOT NULL COMMENT '手机号码',
  `is_default` tinyint(4) DEFAULT NULL COMMENT '是否是默认地址  0-否 1-是',
  `status` tinyint(4) NOT NULL COMMENT '0-初始化  1-正常',
  `gmt_create` datetime NOT NULL COMMENT '创建时间',
  `gmt_modified` datetime NOT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`),
  KEY `idx_userid` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=34 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='用户收货地址表';

