-- ----------------------------
--  Table structure for `user_bank`
-- ----------------------------
DROP TABLE IF EXISTS `user_bank`;
CREATE TABLE `user_bank` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '自增主键',
  `user_id` bigint(20) NOT NULL COMMENT '用户id',
  `bank_code` varchar(15) DEFAULT NULL COMMENT '银行编码',
  `bank_name` varchar(20) DEFAULT NULL COMMENT '开户行名称',
  `bank_barch_name` varchar(20) DEFAULT NULL COMMENT '开户银行支行名称',
  `bank_account_name` varchar(30) DEFAULT NULL COMMENT '开户名',
  `bank_card_no` varchar(25) NOT NULL COMMENT '银行卡号',
  `card_type` varchar(5) NOT NULL COMMENT '银行卡类型   DC: "储蓄卡",CC: "信用卡", SCC: "准贷记卡", PC: "预付费卡"',
  `expiration` varchar(10) DEFAULT NULL COMMENT '信用卡过期时间',
  `bank_card_cvv` varchar(5) DEFAULT NULL COMMENT '信用卡cvv',
  `pay_amout` decimal(10,2) DEFAULT NULL COMMENT '认证银行卡的打款金额',
  `pay_time` datetime DEFAULT NULL COMMENT '系统打款时间',
  `pay_url` varchar(200) DEFAULT NULL COMMENT '打款图片',
  `verify_time` datetime DEFAULT NULL COMMENT '认证时间',
  `is_default` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否是默认提现银行卡',
  `status` tinyint(4) NOT NULL COMMENT ' 1-正常 2-已经删除',
  `verify_operator_id` bigint(20) DEFAULT NULL COMMENT '认证的操作员id',
  `verify_operator_name` varchar(20) DEFAULT NULL COMMENT '认证的操作员名称',
  `gmt_create` datetime NOT NULL COMMENT '创建时间',
  `gmt_modified` datetime NOT NULL COMMENT '修改时间',
  `auditing_user_id` bigint(20) DEFAULT NULL COMMENT '操作打款人ID',
  `auditing_user_name` varchar(20) DEFAULT NULL COMMENT '操作打款人名字',
  `auditing_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '打款系统操作时间',
  PRIMARY KEY (`id`),
  KEY `idx_userid_status` (`user_id`,`status`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='用户绑定银行卡表';

