-- ----------------------------
--  Table structure for `user_rank`
-- ----------------------------
DROP TABLE IF EXISTS `user_rank`;
CREATE TABLE `user_rank` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `rank_name` tinyint(4) DEFAULT NULL,
  `min_points` int(11) DEFAULT NULL,
  `max_points` int(11) DEFAULT NULL,
  `gmt_create` datetime DEFAULT NULL,
  `gmt_modified` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='用户等级信誉积分区间及对应权益表';

-- ----------------------------
--  Table structure for `user_sys_msg`
-- ----------------------------
DROP TABLE IF EXISTS `user_sys_msg`;
CREATE TABLE `user_sys_msg` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) NOT NULL COMMENT '用户id',
  `msg_type` tinyint(4) NOT NULL COMMENT '消息类型 1-系统类通知 2-订单类通知',
  `msg_title` varchar(30) NOT NULL COMMENT '消息标题',
  `msg_content` varchar(500) NOT NULL COMMENT '消息内容',
  `is_read` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0-未读 1-已读',
  `target_url` varchar(300) DEFAULT NULL COMMENT '消息内容指向的url',
  `gmt_create` datetime NOT NULL COMMENT '创建时间',
  `gmt_modified` datetime NOT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`),
  KEY `idx_userid` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=294 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='用户系统类消息表';

