-- ----------------------------
--  Table structure for `user_verify`
-- ----------------------------
DROP TABLE IF EXISTS `user_verify`;
CREATE TABLE `user_verify` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '自增主键',
  `user_id` bigint(20) NOT NULL COMMENT '用户id',
  `verify_type` tinyint(4) DEFAULT NULL COMMENT '认证类型  1-企业认证  2-个人认证',
  `real_name` varchar(50) NOT NULL COMMENT '真实姓名  个人-身份证姓名  企业-企业名称',
  `org_type` varchar(15) DEFAULT NULL COMMENT '企业性质',
  `idcard_no` varchar(20) NOT NULL COMMENT '证照编号 身份证，营业执照等',
  `idcard_front_url` varchar(200) NOT NULL COMMENT '身份证正面照',
  `idcard_back_url` varchar(200) NOT NULL COMMENT '身份证背面照',
  `licence_url` varchar(200) DEFAULT NULL COMMENT '营业执照地址',
  `province` varchar(10) NOT NULL COMMENT '省',
  `city` varchar(10) NOT NULL COMMENT '市',
  `district` varchar(10) NOT NULL COMMENT '区',
  `address` varchar(200) NOT NULL COMMENT '详细地址',
  `link_tel` varchar(20) NOT NULL COMMENT '联系电话',
  `status` tinyint(4) NOT NULL COMMENT '0-待审核  1-认证通过   9-不通过',
  `remark` varchar(200) DEFAULT NULL COMMENT '备注',
  `gmt_create` datetime NOT NULL COMMENT '创建时间',
  `gmt_modified` datetime NOT NULL COMMENT '修改时间',
  `reason` varchar(255) DEFAULT NULL COMMENT '审核拒绝 原因',
  `auditing_user_id` bigint(20) DEFAULT NULL,
  `auditing_user_name` varchar(20) DEFAULT NULL,
  `auditing_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
